import React from "react";
import { useParams } from "react-router-dom";

import data from "../../data";

const Article = () => {
  const [article, setArticle] = useState();
  const { id } = useParams();

  for (const d of data) {
    if (d.id === id) {
      setArticle(d);
    }
  }

  return <div>Article {id}</div>;
};

export default Article;
